webpackJsonp([0xb707735299e7],{1448:function(p,a){p.exports={data:{markdownRemark:{html:"<p>友人が私に子供がいるかどうか聞いたら、子供がいないと言った。私は尋ねられました、あなたは家族についてどう思いますか？私はまた良い家族を作りたいと言っていました。忙しい人は暖かい家を望んでいます。しかし、時には方法がありません、そしてそれは絶望的です。</p>\n<p>歩いているうちに、私は木の上にいくつかの桑の実を選び、ルソーが言った自然状態を考えました。この種の人生は絶望的なものではありません。詩を入手する：</p>\n<p>ビッグブラザーと一緒に旅行する</p>\n<p>プールの湾曲をクリアし、</p>\n<p>緑の丘の上のグリーンストーンを踏む。</p>\n<p>町の4つの柱は、</p>\n<p>1つの塔には水プールがありません。</p>\n<p>夏の宮殿は深くて見つけやすい。</p>\n<p>昆明湖で魚を見るのは難しいです。</p>\n<p>数千の花を取り去り、</p>\n<p>君主として東から夏色。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0096.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0096.md",frontmatter:{title:"5月25日 水曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0096.md absPath of file >>> MarkdownRemark"}}}});
